DealTerms._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'AllDealsCancelled'), pyxb.binding.datatypes.boolean, scope=DealTerms, documentation='The Flag indicating whether all Deals\n                     are cancelled for the given Territories (=true) or not (=false). This Flag can\n                     be used in conjunction with a StartDate of a ValidityPeriod to indicate the\n                     point in time from which all Deals are cancelled. This element is deprecated.\n                     DDEX advises that it may be removed at a future date and therefore recommends\n                     against using it.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 1084, 12)))

DealTerms._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'TakeDown'), pyxb.binding.datatypes.boolean, scope=DealTerms, documentation="The Flag indicating whether all\n                     Releases referred to are to be taken down by the MessageRecipient. This\n                     includes that all Deals referred to in a specific Composite are cancelled and\n                     no information about the Releases should be displayed to the end user on the\n                     DSP's website (=true) or not (=false). This element is deprecated. DDEX advises\n                     that it may be removed at a future date and therefore recommends against using\n                     it.", location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 1094, 12)))

DealTerms._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'TerritoryCode'), CurrentTerritoryCode, scope=DealTerms, documentation="A Territory in which the Deal applies.\n                     Either this Element or ExcludedTerritory must be present, but not both. The use\n                     of ISO TerritoryCodes (or the term 'Worldwide) is strongly encouraged; TIS\n                     TerritoryCodes should only be used if both MessageSender and MessageRecipient\n                     are familiar with this standard. ", location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 1107, 12)))

