DealTerms._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'DistributionChannel'), DSP, scope=DealTerms, documentation='A Composite containing details of the\n                     DSP through whose DistributionChannel the sales are permitted. If none are\n                     provided no limitations on the DistributionChannels are\n                     given.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 1128, 12)))

