TechnicalMidiDetails._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'Duration'), pyxb.binding.datatypes.duration, scope=TechnicalMidiDetails, documentation='The Duration of the instantiation of the\n                  MIDI if this differs from the Duration provided for the MIDI itself (using the ISO\n                  8601:2004 PT[[hhH]mmM]ssS format, where lower case characters indicate variables,\n                  upper case characters are part of the xs:string, e.g. one hour, two minutes and\n                  three seconds would be PT1H2M3S). The seconds section ss may include fractions\n                  (e.g. one minute and 30.5 seconds would be PT1M30.5S). This element must only be\n                  used if and when there are no royalty reporting implications on this change in\n                  duration and when the specific technical instantiation is a clip taken from a\n                  technical instantiation representing the whole MIDI.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 4096, 9)))

TechnicalMidiDetails._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ResourceProcessingRequired'), pyxb.binding.datatypes.boolean, scope=TechnicalMidiDetails, documentation='The Flag indicating whether the MIDI needs\n                  to be processed (=true) or not (=false) (typically: transcoded) by the\n                  MessageRecipient before being delivered to Consumers.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 4109, 9)))

TechnicalMidiDetails._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'UsableResourceDuration'), pyxb.binding.datatypes.duration, scope=TechnicalMidiDetails, documentation="The Duration of the MIDI that may be sold\n                  to a Consumer if the MIDI provided is not intended to be provided to Consumers 'as\n                  is' but will need to be transcoded into an appropriate format by the\n                  MessageRecipient or any other DSP handling the Release before it is sold (using\n                  the ISO 8601:2004 PT[[hhH]mmM]ssS format, where lower case characters indicate\n                  variables, upper case characters are part of the xs:string, e.g. one hour, two\n                  minutes and three seconds would be PT1H2M3S). The seconds section ss may include\n                  fractions (e.g. one minute and 30.5 seconds would be\n                  PT1M30.5S).", location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 4116, 9)))

TechnicalMidiDetails._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'IsPreview'), pyxb.binding.datatypes.boolean, scope=TechnicalMidiDetails, documentation='The Flag indicating whether the MIDI is\n                  technically a preview of the parent Resource (=true) or not (=false). Note that\n                  nothing can be implied from this element as to the conditions under which the\n                  preview can be made available.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 4129, 9)))

