TechnicalSoundRecordingDetails._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'UsableResourceDuration'), pyxb.binding.datatypes.duration, scope=TechnicalSoundRecordingDetails, documentation="The Duration of the SoundRecording that\n                  may be sold to a Consumer if the SoundRecording provided is not intended to be\n                  provided to Consumers 'as is' but will need to be transcoded into an appropriate\n                  format by the MessageRecipient or any other DSP handling the Release before it is\n                  sold (using the ISO 8601:2004 PT[[hhH]mmM]ssS format, where lower case characters\n                  indicate variables, upper case characters are part of the xs:string, e.g. one\n                  hour, two minutes and three seconds would be PT1H2M3S). The seconds section ss may\n                  include fractions (e.g. one minute and 30.5 seconds would be\n                  PT1M30.5S).", location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 4466, 9)))

TechnicalSoundRecordingDetails._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'IsPreview'), pyxb.binding.datatypes.boolean, scope=TechnicalSoundRecordingDetails, documentation='The Flag indicating whether the\n                  SoundRecording is technically a preview of the parent Resource (=true) or not\n                  (=false). Note that nothing can be implied from this element as to the conditions\n                  under which the preview can be made available.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 4479, 9)))

