ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'SequenceNumber'), pyxb.binding.datatypes.integer, scope=ExtendedResourceGroupContentItem, documentation='The number indicating the order of the\n                  ContentItem among all Resources within this ResourceGroup. This is analogous to\n                  the Track number on a SoundCarrier. Not all ResourceGroups necessarily have\n                  SequenceNumbers (it is most applicable to SoundRecordings and\n                  MusicalWorkVideos).', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7620, 9)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'SequenceSubNumber'), pyxb.binding.datatypes.integer, scope=ExtendedResourceGroupContentItem, documentation='The SequenceNumber within the\n                  SequenceNumber. Example: if a Track is subdivided into several numbered sections,\n                  these are numbered with a SequenceSubNumber. The SequenceSubNumber is unique\n                  within its SequenceNumber.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7629, 9)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ResourceType'), ResourceType, scope=ExtendedResourceGroupContentItem, documentation='A Composite containing details of the Type\n                  of the ContentItem.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7637, 9)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ReleaseResourceReference'), ReleaseResourceReference, scope=ExtendedResourceGroupContentItem, documentation='A Composite containing a\n                  ReleaseResourceReference for the ContentItem (specific to this Message). The\n                  LocalAnchorReference in this Composite is a xs:string starting with the letter\n                  A.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7643, 9)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'LinkedReleaseResourceReference'), LinkedReleaseResourceReference, scope=ExtendedResourceGroupContentItem, documentation='A Composite containing details of a\n                  ReleaseResourceReference (specific to this Message) for a Resource which is linked\n                  to this ContentItem. Example: an Image, Text or NonMusicalWorkVideo associated\n                  with a SoundRecording. This LocalAnchorReference is a xs:string starting with the\n                  letter A.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7651, 9)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ResourceGroupContentItemReleaseReference'), STD_ANON_32, scope=ExtendedResourceGroupContentItem, documentation='The Identifier (specific to the\n                     Message) of a Release which has the same content as the\n                     ResourceGroupContentItem. This is a LocalReleaseAnchorReference starting with\n                     the letter R.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7662, 12)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'ReleaseId'), ReleaseId, scope=ExtendedResourceGroupContentItem, documentation='A Composite containing details of\n                     ReleaseIds of a Release which has the same content as the\n                     ResourceGroupContentItem. If available, a GRid has to be used. If the Release\n                     contains only one SoundRecording, the ISRC of the SoundRecording may be used\n                     instead. If the Release is an abstraction of a complete PhysicalProduct (such\n                     as a CD Album), the ICPN of the PhysicalProduct may be used\n                     instead.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7675, 12)))

ExtendedResourceGroupContentItem._AddElement(pyxb.binding.basis.element(pyxb.namespace.ExpandedName(None, 'Duration'), pyxb.binding.datatypes.duration, scope=ExtendedResourceGroupContentItem, documentation='The Duration of the ContentItem featured,\n                  if it is a SoundRecording or Video (using the ISO 8601:2004 PT[[hhH]mmM]ssS\n                  format, where lower case characters indicate variables, upper case characters are\n                  part of the xs:string, e.g. one hour, two minutes and three seconds would be\n                  PT1H2M3S). The seconds section ss may include fractions (e.g. one minute and 30.5\n                  seconds would be PT1M30.5S). This Duration may be less than the normal Duration of\n                  the ContentItem, if only a part of it is included.', location=pyxb.utils.utility.Location('http://service.ddex.net/xml/ern/382/release-notification.xsd', 7687, 9)))

